			<div class="excerpt">
		
			<p class="dropcap bl">As delicious as it is to have a long, languorous lunch, it isn’t always possible to have two bottles and let the hours slip away. Sometimes we need something snappy. The problem is, a whole set of denigrating values comes with the notion of fast food. Words commonly linked to the term include insipid, low quality, mass produced and so on. It is enough to have you reaching for a bottle at 1.00pm. This snootiness is simply not always. </p>			
